「特許消臭技術」により、汗臭・体臭を消臭。天然アロマオイル配合のナチュラルな香りが楽しめるアロマ柔軟剤。<br><br>●特許消臭技術の「ナノ消臭成分」が体臭の気になる衣類もセンイの芯からしっかり消臭！<br>●「消臭ハーブカプセル」が、一日の終わりまで、汗や体臭などイヤなニオイをしっかり消臭！<br>●部屋干し抗菌成分配合で、部屋干し中もイヤなニオイを防いでアロマの香りが広がる！<br>●天然アロマオイル配合のナチュラルな香りでアロマ感覚のお洗濯が楽しめる！<br>●植物生まれの柔軟成分が、センイの1本1本まで柔らかく仕上げ、静電気も防ぐ！<br>●汗やタバコなどのイヤなニオイが衣類につくのを防ぐ！<br>●ミュゲ(スズラン)を中心としたフローラルの香りに、グリーンティーやティーツリーをブレンドしたすがすがしいハーブの香りです。<br><br>【使用上の注意】<br>・乳幼児の手の届くところに置かないでください。<br>・認知症の方などの誤飲を防ぐため、置き場所に注意してください。<br>・用途外に使わないでください。<br>・液を直接衣類にかけないでください。<br>・液がこぼれた場合はすぐに水でふきとってください。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ライオン<br>シリーズ名：ソフラン<br>内容量：480ml×16個<br>成分：エチルアルコール、香料、消臭剤、塩化カルシウム、抗菌剤、BHT、防腐剤<br><br>購入単位：1箱（16個）<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4903301255093 SK5328 sk5328 ライオン らいおん LION lion ライオン株式会社 柔軟剤 衣類用 衣類 服 衣服 洗たく用品 洗濯用品 洗濯 洗たく せんたく ソフラン そふらん 香りとデオドラントのソフラン かおりとでおどらんとのそふらん 香りソフラン デオドラントソフラン 消臭 プレミアム消臭 プレミアム消臭プラス 汗のニオイ 汗の臭い 汗臭 汗 タバコのニオイ タバコの臭い たばこのニオイ たばこの臭い タバコ臭 たばこ臭 体臭 体の臭い 体のニオイ 天然アロマオイル 天然アロマオイル配合 抗菌 静電気を防ぐ 静電気防止 つめかえ ツメカエ 詰め替え 詰替 詰替え 替え かえ 替 ホワイトハーブアロマ ほわいとはーぷあろま ホワイトハーブ ほわいとはーぶ ハーブの香り ハーブのかおり</font></td></tr></table><style type="text/css">
